import React from 'react';
import Slider from 'react-slick';
import './ImageCarouselCard.css'; // Import the CSS file

const ImageCarouselCard = () => {
  const images = [
    'src\\assets\\default_img.jpg',
    'https://via.placeholder.com/600x300?text=Image+2',
    'https://via.placeholder.com/600x300?text=Image+3',
    'https://via.placeholder.com/600x300?text=Image+4',
    'https://via.placeholder.com/600x300?text=Image+5',
  ];

  // Slick carousel settings
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <div className="carousel-card">
      <h3 className="carousel-title">Image Carousel</h3>
      <div className="carousel-container">
        <Slider {...settings}>
          {images.map((image, index) => (
            <div key={index}>
              <img src={image} alt={`Carousel ${index}`} className="carousel-image" />
            </div>
          ))}
        </Slider>
      </div>
    </div>
  );
};

export default ImageCarouselCard;
